"use strict";
var Prelude = require("Prelude");
var Control_Monad_Eff = require("Control.Monad.Eff");

function log(a) {
  console.log(a);
  return a;
}
;

function trace(a) {
  return function() {
    console.log(a);
    return a;
  };
}
;
var whisper = function (a) {
    return function __do() {
        trace(a)();
        return Prelude.unit;
    };
};
module.exports = {
    log: log, 
    trace: trace, 
    whisper: whisper
};
